DROP TABLE IF EXISTS `bbc_user_field`;
CREATE TABLE `bbc_user_field` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `group_id` int(11) NOT NULL DEFAULT '0',
  `type` varchar(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `tips` varchar(255) NOT NULL,
  `checked` enum('any','email','url','phone','number') NOT NULL DEFAULT 'any',
  `attr` varchar(255) NOT NULL,
  `default` text NOT NULL,
  `option` text NOT NULL,
  `orderby` int(255) NOT NULL DEFAULT '1',
  `mandatory` tinyint(1) NOT NULL DEFAULT '0',
  `active` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `active` (`active`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

INSERT INTO `bbc_user_field` VALUES (5,0,'textarea','Alamat Lengkap','','any','','','',2,1,1),(6,0,'text','Phone','','phone','','','',1,1,1);
DROP TABLE IF EXISTS `bbc_user_group`;
CREATE TABLE `bbc_user_group` (
  `id` int(255) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `desc` varchar(255) DEFAULT NULL,
  `menus` text,
  `cpanels` text,
  `score` int(11) NOT NULL DEFAULT '0',
  `is_customfield` tinyint(1) NOT NULL DEFAULT '0',
  `is_admin` tinyint(2) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `is_admin` (`is_admin`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

INSERT INTO `bbc_user_group` VALUES (1,'root','this is the highest degree of user level in system',',all,',',all,',0,0,1),(2,'administrator','administrator','',',2,15,16,',0,0,1),(3,'Customer','Customer',',all,','',0,1,0),(4,'Registered','lowest level of member site','','',0,0,0),(5,'Teacher','teacher role',',all,','',0,0,0),(6,'Parent','parent role',',all,','',0,0,0),(7,'Student','student role',',all,','',0,0,0);
DROP TABLE IF EXISTS `bbc_user_push`;
CREATE TABLE `bbc_user_push` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) DEFAULT '0',
  `group_ids` varchar(120) DEFAULT '0' COMMENT 'comma separated like repairImplode()',
  `username` varchar(120) DEFAULT NULL,
  `token` varchar(255) DEFAULT NULL,
  `type` tinyint(1) DEFAULT '0' COMMENT '0=expo, 1=fcm',
  `device` varchar(255) DEFAULT NULL,
  `os` varchar(60) DEFAULT NULL,
  `ipaddress` varchar(20) DEFAULT NULL,
  `created` datetime DEFAULT CURRENT_TIMESTAMP,
  `updated` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'setiap mengirim pesan ke table bbc_user_push_notif maka field ini akan di update',
  PRIMARY KEY (`id`),
  KEY `group_ids` (`group_ids`) USING BTREE,
  KEY `os` (`os`) USING BTREE,
  KEY `type` (`type`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=318 DEFAULT CHARSET=utf8 COMMENT='table untuk menyimpan token dari para pengguna mobile app';

